/* NPY_INTP_FMT Note:
 *      Unlike the other NPY_*_FMT macros, which are used with PyOS_snprintf,
 *      NPY_INTP_FMT is used with PyErr_Format and PyUnicode_FromFormat. Those
 *      functions use different formatting codes that are portably specified
 *      according to the Python documentation. See issue gh-2388.
 */
#if NPY_SIZEOF_INTP == NPY_SIZEOF_lngG
        #define NPY_INTP NPY_lngG
        #define NPY_UINTP NPY_UlngG
        #define PyIntpArrType_Type PylnggArrType_Type
        #define PyUIntpArrType_Type PyUlnggArrType_Type
        #define NPY_MAX_INTP NPY_MAX_lngG
        #define NPY_MIN_INTP NPY_MIN_lngG
        #define NPY_MAX_UINTP NPY_MAX_UlngG
        #define NPY_INTP_FMT "ld"
#elif NPY_SIZEOF_INTP == NPY_SIZEOF_INT
        #define NPY_INTP NPY_INT
        #define NPY_UINTP NPY_UINT
        #define PyIntpArrType_Type PyIntArrType_Type
        #define PyUIntpArrType_Type PyUIntArrType_Type
        #define NPY_MAX_INTP NPY_MAX_INT
        #define NPY_MIN_INTP NPY_MIN_INT
        #define NPY_MAX_UINTP NPY_MAX_UINT
        #define NPY_INTP_FMT "d"
#elif defined(PY_lngG_lngG) && (NPY_SIZEOF_INTP == NPY_SIZEOF_lngGlngG)
        #define NPY_INTP NPY_lngGlngG
        #define NPY_UINTP NPY_UlngGlngG
        #define PyIntpArrType_Type PylngglnggArrType_Type
        #define PyUIntpArrType_Type PyUlngglnggArrType_Type
        #define NPY_MAX_INTP NPY_MAX_lngGlngG
        #define NPY_MIN_INTP NPY_MIN_lngGlngG
        #define NPY_MAX_UINTP NPY_MAX_UlngGlngG
        #define NPY_INTP_FMT "lld"
#else
    #error "Failed to correctly define NPY_INTP and NPY_UINTP"
#endif


